<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <title>DEEP-FOREST-CLUB DOCS</title>
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <meta name="description" content="Description">
  <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0">
  <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/docsify@4/lib/themes/vue.css">
</head>
<body>
  <div id="app"></div>
  <script>
    window.$docsify = {
      name: 'DEEP-FOREST-CLUB DOCS',
      repo: 'https://github.com/DeepForestClub/deepforestclub.github.io',
      coverpage: {
        '/': '_cover.md',
        '/zh-cn/': 'zh-cn/_cover.md',
        '/zh-tr/': 'zh-tr/_cover.md'
      },
      nameLink: {
        '/': '/',
        '/zh-cn/': '/zh-cn/',
        '/zh-tr/': '/zh-tr/'
      },
      mergeNavbar: true,
      formatUpdated: '{YYYY}/{MM}/{DD} {HH}:{mm}',
      fallbackLanguages: ['en', 'zh-cn', 'zh-tr'],
      notFoundPage: {
        '/': '_404.md',
        '/zh-cn/': 'zh-cn/_404.md',
        '/zh-tr/': 'zh-tr/_404.md'
      },
      loadSidebar: true,
      subMaxLevel: 2,
      plugins: [
        function(hook, vm) {
          hook.doneEach(function() {
            DocsifyZoomImage.create();
            DocsifyCopyCode.create();
            if (vm._mixinInit) {
              vm._mixinInit();
            }
          });
        }
      ]
    };
  </script>
  <script src="https://cdn.jsdelivr.net/npm/docsify-edit-on-github@3"></script>
  <script src="//cdn.jsdelivr.net/npm/docsify/lib/plugins/zoom-image.min.js"></script>
  <script src="//cdn.jsdelivr.net/npm/docsify-copy-code/dist/docsify-copy-code.min.js"></script>
  <script src="//cdn.jsdelivr.net/npm/docsify@4"></script>
  <script>
    if (typeof navigator.serviceWorker !== 'undefined') {
      navigator.serviceWorker.register('sw.js');
    }

    window.$docsify.plugins.push(EditOnGithubPlugin.create("https://github.com/DeepForestClub/deepforestclub.github.io/blob/master/docs/"));
  </script>
</body>
</html>
